import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

// Minimal test to isolate the issue
function MinimalApp() {
  return (
    <div style={{ padding: '2rem', background: '#f5f1ec', minHeight: '100vh' }}>
      <h1>Minimal App Test</h1>
      <p>If you see this, React is working. The issue is in the main App component.</p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <MinimalApp />
  </React.StrictMode>
);
